import React from 'react'
import { Navbar, Container, Nav, Button } from 'react-bootstrap'
import { useNavigate } from 'react-router-dom'

export default function TopNav(){
  const nav = useNavigate()
  const logout = () => { localStorage.removeItem('deserveiq_user'); nav('/login') }
  return (
    <Navbar bg="light" expand="lg" className="shadow-sm">
      <Container fluid>
        <Navbar.Brand onClick={()=>nav('/')} style={{cursor:'pointer'}}>DeserveIQ</Navbar.Brand>
        <Nav className="ms-auto">
          <Nav.Link onClick={()=>nav('/predict')}>Single Predict</Nav.Link>
          <Nav.Link onClick={()=>nav('/batch')}>Batch Upload</Nav.Link>
          <Nav.Link onClick={()=>nav('/students')}>Students</Nav.Link>
          <Button variant="outline-danger" size="sm" onClick={logout} className="ms-2">Logout</Button>
        </Nav>
      </Container>
    </Navbar>
  )
}
